#include "SilhouetteData.h"

void SilhouetteData::startSetting()
{
	if(myType == 1)
		startSetting1();
	else if(myType == 2)
		startSetting2();
	else if(myType == 3)
		startSetting3();
	else if(myType == 4)
		startSetting4();
	else if(myType == 5)
		startSetting5();
	else if(myType == 6)
		startSetting6();
	else if(myType == 7)
		startSetting7();
	else if(myType == 8)
		startSetting8();
}

void SilhouetteData::startSetting1()
{
	string t_sil = "";
	
	must_cnt = 0;
	
	for(int i=mapHeightInnerEnd-1;i>=mapHeightInnerBegin;i--)
	{
		string t_t = t_sil.substr((mapHeightInnerEnd-1 - i)*160,160);
		for(int j=mapWidthInnerBegin;j<mapWidthInnerEnd;j++)
		{
			if(t_t.at(j-1) == '0')
			{
				silData[j][i] = true;
				must_cnt++;
			}
			else
			{
				silData[j][i] = false;
			}
		}
	}
}

